const cName = 'menu-item';
const menuItems = [
    {
        name: 'Today',
        path: '/',
        cName,
        dropdown: [<i className="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Calandar',
        path: '/',
        cName
    },
    {
        name: 'Projects',
        path: '/',
        cName, 
        dropdown: [<i class="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Uncatgorized',
        path: '/',
        cName,
        dropdown: [<i class="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Tags',
        path: '/',
        cName,
        dropdown: [<i class="fa-solid fa-caret-right"></i>, <i class="fa-solid fa-caret-down"></i>]
    },
    {
        name: 'Notebook',
        path: '/',
        cName
    },
]

export default menuItems;
